
<!DOCTYPE html>
<html lang="es">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Dashboard Operativo de Flota</title>
    
    <!-- Dependencias externas (CDN) -->
    <script src="https://cdn.tailwindcss.com"></script>
    <script src="https://cdn.jsdelivr.net/npm/chart.js"></script>
    <script src="https://cdn.jsdelivr.net/npm/chartjs-adapter-date-fns/dist/chartjs-adapter-date-fns.bundle.min.js"></script>
    <script src="https://cdn.jsdelivr.net/npm/chartjs-plugin-datalabels@2.2.0/dist/chartjs-plugin-datalabels.min.js"></script>
    <script src="https://unpkg.com/lucide@latest/dist/umd/lucide.min.js"></script>
    <link href="https://cdn.jsdelivr.net/npm/slim-select@2.8.1/dist/slimselect.min.css" rel="stylesheet"></link>
    <script src="https://cdn.jsdelivr.net/npm/slim-select@2.8.1/dist/slimselect.min.js"></script>

    <!-- Estilos CSS personalizados y fuente -->
    <style>
        @import url('https://fonts.googleapis.com/css2?family=Inter:wght@400;500;600;700&display=swap');
        body { font-family: 'Inter', sans-serif; background-color: #f8fafc; font-size: 14px; }
        .card { background-color: white; border-radius: 0.75rem; box-shadow: 0 1px 3px 0 rgb(0 0 0 / 0.05); border: 1px solid #e2e8f0; padding: 1.5rem; transition: all 0.3s ease-in-out; }
        .toggle-label { transition: background-color 0.2s ease-in-out; }
        .toggle-checkbox:checked ~ .dot { transform: translateX(100%); }
        .toggle-checkbox:checked ~ .block { background-color: #3b82f6; }
        .accordion-content { max-height: 0; overflow: hidden; transition: max-height 0.3s ease-out; }
        .accordion-button { transition: background-color 0.2s; border-radius: 0.5rem; }
        .accordion-button:hover { background-color: #f9fafb; }
        .accordion-button .chevron { transition: transform 0.3s ease-out; }
        .accordion-button.open .chevron { transform: rotate(180deg); }
        .weekend-highlight { color: #3b82f6; }
        .view-btn { transition: all 0.2s; }
        .view-btn.active { background-color: #3b82f6; color: white; }
        .day-tab { transition: all 0.2s; }
        .day-tab.active { background-color: #eef2ff; color: #3b82f6; font-weight: 600; }
        #toast-message { transition: opacity 0.3s, transform 0.3s; }
        #refresh-btn:disabled { cursor: not-allowed; background-color: #9ca3af; }
    </style>
</head>
<body class="antialiased text-gray-700">

    <div class="min-h-screen p-3 sm:p-4">
        <div class="max-w-screen-xl mx-auto">

            <header class="mb-6">
                <div class="flex justify-between items-center mb-2">
                    <a href="sucursales.html" class="text-gray-400 hover:text-gray-700" title="Volver a Sucursales">
                        <i data-lucide="arrow-left" class="w-6 h-6"></i>
                    </a>
                    <div class="flex items-center gap-4">
                        <p class="text-xs text-gray-500">Última Actualización: <span id="last-updated" class="font-medium"></span></p>
                        <button id="refresh-btn" class="flex items-center gap-2 px-3 py-1.5 text-xs font-semibold text-white bg-blue-500 rounded-lg hover:bg-blue-600 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500">
                            <i data-lucide="refresh-cw" class="w-3 h-3"></i>
                            <span>Actualizar</span>
                        </button>
                    </div>
                </div>
                <h1 class="text-3xl font-bold text-gray-900">Dashboard Operativo de Flota</h1>
                <p class="text-sm text-gray-500">Análisis operativo de devoluciones y salidas.</p>
            </header>

            <!-- Controles y Filtros -->
            <div class="grid grid-cols-1 lg:grid-cols-3 gap-6 mb-6">
                 <div class="card lg:col-span-2">
                    <div class="flex justify-between items-center mb-1">
                        <label for="filtro-agencia" class="text-base font-semibold">Filtro por Agencia(s)</label>
                        <div class="space-x-2">
                             <button id="deselect-all-agencies" class="text-xs font-medium text-gray-500 hover:text-gray-800">Ninguna</button>
                            <button id="select-all-agencies" class="text-xs font-medium text-gray-500 hover:text-gray-800">Todas</button>
                        </div>
                    </div>
                    <select id="filtro-agencia" multiple></select>
                </div>
                <div class="card">
                    <h3 class="text-base font-semibold mb-3">Controles de Visualización</h3>
                    <div class="flex items-center justify-around">
                        <label for="toggle-devoluciones" class="flex items-center space-x-2 cursor-pointer text-sm">
                            <div class="relative"><input type="checkbox" id="toggle-devoluciones" class="sr-only toggle-checkbox" checked><div class="block bg-gray-200 w-10 h-6 rounded-full toggle-label"></div><div class="dot absolute left-1 top-1 bg-white w-4 h-4 rounded-full transition"></div></div>
                            <span>Devoluciones</span>
                        </label>
                        <label for="toggle-salidas" class="flex items-center space-x-2 cursor-pointer text-sm">
                            <div class="relative"><input type="checkbox" id="toggle-salidas" class="sr-only toggle-checkbox" checked><div class="block bg-gray-200 w-10 h-6 rounded-full toggle-label"></div><div class="dot absolute left-1 top-1 bg-white w-4 h-4 rounded-full transition"></div></div>
                            <span>Salidas</span>
                        </label>
                        <label for="toggle-agrupar" class="flex items-center space-x-2 cursor-pointer text-sm">
                            <div class="relative"><input type="checkbox" id="toggle-agrupar" class="sr-only toggle-checkbox" checked><div class="block bg-gray-200 w-10 h-6 rounded-full toggle-label"></div><div class="dot absolute left-1 top-1 bg-white w-4 h-4 rounded-full transition"></div></div>
                            <span>Agrupar</span>
                        </label>
                    </div>
                </div>
            </div>

            <!-- Controles de Vista de Gráficos -->
            <div class="card mb-6">
                <div class="flex flex-col sm:flex-row items-center justify-between gap-4">
                    <div class="flex items-center gap-2">
                        <h3 class="text-base font-semibold">Modo de Vista</h3>
                        <div class="inline-flex rounded-md shadow-sm" role="group">
                            <button type="button" id="view-general-btn" class="view-btn active px-4 py-2 text-sm font-medium text-gray-900 bg-white border border-gray-200 rounded-l-lg hover:bg-gray-100 focus:z-10 focus:ring-2 focus:ring-blue-700">General</button>
                            <button type="button" id="view-focus-btn" class="view-btn px-4 py-2 text-sm font-medium text-gray-900 bg-white border-t border-b border-r border-gray-200 rounded-r-lg hover:bg-gray-100 focus:z-10 focus:ring-2 focus:ring-blue-700">Enfocada</button>
                        </div>
                    </div>
                    <div id="day-tabs-container" class="hidden" role="group">
                        <div class="inline-flex rounded-md shadow-sm">
                            <button type="button" class="day-tab active px-4 py-2 text-sm font-medium text-gray-900 bg-white border border-gray-200 rounded-l-lg hover:bg-gray-100" data-day="hoy">Hoy</button>
                            <button type="button" class="day-tab px-4 py-2 text-sm font-medium text-gray-900 bg-white border-t border-b border-gray-200 hover:bg-gray-100" data-day="manana">Mañana</button>
                            <button type="button" class="day-tab px-4 py-2 text-sm font-medium text-gray-900 bg-white border-r border-t border-b border-gray-200 rounded-r-lg hover:bg-gray-100" data-day="pasado">Pasado Mañana</button>
                        </div>
                    </div>
                </div>
            </div>

            <!-- Contenedor de Gráficos -->
            <div id="charts-container" class="grid grid-cols-1 lg:grid-cols-3 gap-6 mb-6">
                <div id="card-hoy" class="card">
                    <h2 id="title-hoy" class="text-lg font-semibold mb-2 capitalize"></h2>
                    <div class="h-80"><canvas id="chart-hoy"></canvas></div>
                    <div id="summary-hoy" class="mt-3 border-t pt-3 text-sm space-y-2"></div>
                </div>
                <div id="card-manana" class="card">
                    <h2 id="title-manana" class="text-lg font-semibold mb-2 capitalize"></h2>
                    <div class="h-80"><canvas id="chart-manana"></canvas></div>
                    <div id="summary-manana" class="mt-3 border-t pt-3 text-sm space-y-2"></div>
                </div>
                <div id="card-pasado" class="card">
                    <h2 id="title-pasado" class="text-lg font-semibold mb-2 capitalize"></h2>
                    <div class="h-80"><canvas id="chart-pasado"></canvas></div>
                    <div id="summary-pasado" class="mt-3 border-t pt-3 text-sm space-y-2"></div>
                </div>
                 <div id="card-combined" class="card hidden lg:col-span-3">
                    <h2 id="title-combined" class="text-lg font-semibold mb-2 capitalize">Vista Combinada</h2>
                    <div class="h-80"><canvas id="chart-combined"></canvas></div>
                    <div id="summary-combined" class="mt-3 border-t pt-3 text-sm space-y-2"></div>
                </div>
            </div>
            
            <!-- Alertas de Devoluciones Vencidas -->
            <div class="card">
                <button id="accordion-button" class="w-full flex items-center justify-between p-2 bg-slate-50 border border-slate-200">
                    <div class="flex items-center gap-3">
                        <i data-lucide="siren" class="w-6 h-6 text-red-600"></i>
                        <h2 class="text-lg font-semibold">Alertas: Devoluciones Vencidas <span id="alertas-count" class="text-red-600 font-bold"></span></h2>
                    </div>
                    <i data-lucide="chevron-down" class="w-5 h-5 chevron"></i>
                </button>
                <div id="accordion-content" class="accordion-content mt-4">
                    <div class="overflow-auto max-h-60">
                        <table class="w-full text-left text-xs">
                            <thead class="sticky top-0 bg-white">
                                <tr>
                                    <th class="p-2 font-semibold text-gray-600 border-b">Estado</th>
                                    <th class="p-2 font-semibold text-gray-600 border-b">Contrato / ID</th>
                                    <th class="p-2 font-semibold text-gray-600 border-b">Agencia</th>
                                    <th class="p-2 font-semibold text-gray-600 border-b">Situación</th>
                                    <th class="p-2 font-semibold text-gray-600 border-b">Fecha Venc.</th>
                                </tr>
                            </thead>
                            <tbody id="overdue-table-body"></tbody>
                        </table>
                    </div>
                </div>
            </div>
        </div>
    </div>
    
    <!-- Mensaje Toast para notificaciones -->
    <div id="toast-message" class="fixed bottom-5 right-5 bg-gray-800 text-white text-sm font-semibold py-2 px-4 rounded-lg shadow-lg opacity-0 transform translate-y-2">
        <p id="toast-text"></p>
    </div>

                const diffMinutes = (now - updateTimestamp) / (1000 * 60);
                if (diffMinutes < 5) { // Cambiado a 5 minutos
                    showToast(`Debe esperar ${Math.ceil(3 - diffMinutes)} minutos para actualizar.`);
                    return;
                }

                const originalContent = uiElements.refreshBtn.innerHTML;
                uiElements.refreshBtn.disabled = true;
                uiElements.refreshBtn.innerHTML = '<i data-lucide="loader-2" class="w-3 h-3 animate-spin"></i><span>Actualizando...</span>';
                lucide.createIcons();

                fetch('https://n8n.localiza-ar.com/webhook/6a9f4ac9-c7fa-420b-9a94-99e2304e64a5', { method: 'POST', body: '{}' })
                    .then(response => {
                        if (!response.ok) throw new Error('La respuesta del Webhook no fue exitosa.');
                        showToast('Datos actualizados. Recargando página...');
                        setTimeout(() => location.reload(), 1500); // Espera para que el usuario lea el mensaje
                    })
                    .catch(error => {
                        console.error('Error en el Webhook:', error);
                        showToast('Error al actualizar. Intente de nuevo.');
                        uiElements.refreshBtn.disabled = false;

            const ahora = new Date();

            const fechaPasado = new Date(fechaHoy); fechaPasado.setDate(fechaHoy.getDate() + 2);
            const dates = { hoy: fechaHoy, manana: fechaManana, pasado: fechaPasado };

            const formatTitle = (prefix, date) => {

                return `<span class="${isWeekend ? 'weekend-highlight' : ''}">${prefix} (${dateString})</span>`;
            };
            document.getElementById('title-hoy').innerHTML = formatTitle('Hoy', fechaHoy);
            document.getElementById('title-manana').innerHTML = formatTitle('Mañana', fechaManana);
            document.getElementById('title-pasado').innerHTML = formatTitle('Pasado Mañana', fechaPasado);

            let chartInstances = { hoy: null, manana: null, pasado: null, combined: null };

            function actualizarLayout() {
                document.getElementById('view-general-btn').classList.toggle('active', viewMode === 'general');

                uiElements.dayTabsContainer.classList.toggle('hidden', viewMode !== 'focus');

                Object.values(uiElements.cards).forEach(c => { if(c.id !== 'card-combined') c.classList.toggle('hidden', showCombined) });
                if (viewMode === 'focus' && !showCombined) {
                    uiElements.chartsContainer.className = 'grid grid-cols-1 gap-6 mb-6';
                    Object.entries(uiElements.cards).forEach(([day, card]) => { if (day !== 'combined') card.classList.toggle('hidden', !focusedDays.has(day)); });
                } else if (!showCombined) {
                    uiElements.chartsContainer.className = 'grid grid-cols-1 lg:grid-cols-3 gap-6 mb-6';
                }
                uiElements.dayTabsContainer.querySelectorAll('.day-tab').forEach(tab => tab.classList.toggle('active', focusedDays.has(tab.dataset.day)));
            }

            function actualizarDashboard() {
                actualizarLayout();
                const showDevoluciones = uiElements.toggles.devo.checked;
                const showSalidas = uiElements.toggles.salidas.checked;
                const isStacked = uiElements.toggles.agrupar.checked;
                const agenciasSeleccionadas = filtros.agencia.getSelected();
                const datosFiltradosPorAgencia = masterData.filter(d => agenciasSeleccionadas.length === 0 || agenciasSeleccionadas.includes(d.agencia));
                const limiteDoceDias = new Date(ahora); limiteDoceDias.setDate(ahora.getDate() - 12);
                const vencidos = datosFiltradosPorAgencia.filter(d => d.eventType === 'Devolución' && d.fecha < ahora && d.fecha > limiteDoceDias);
                actualizarTablaVencidos(vencidos, ahora, fechaHoy);
                const limite = new Date(fechaHoy); limite.setDate(fechaHoy.getDate() + 3);
                const datosFuturos = datosFiltradosPorAgencia.filter(d => d.fecha >= fechaHoy && d.fecha < limite);
                const devolucionesFuturas = showDevoluciones ? datosFuturos.filter(d => d.eventType === 'Devolución') : [];
                const salidasFuturas = showSalidas ? datosFuturos.filter(d => d.eventType === 'Salida') : [];
                const dataPorDia = {
                    hoy: { devos: devolucionesFuturas.filter(d => d.fecha.toDateString() === fechaHoy.toDateString()), salidas: salidasFuturas.filter(d => d.fecha.toDateString() === fechaHoy.toDateString()) },
                    manana: { devos: devolucionesFuturas.filter(d => d.fecha.toDateString() === fechaManana.toDateString()), salidas: salidasFuturas.filter(d => d.fecha.toDateString() === fechaManana.toDateString()) },
                    pasado: { devos: devolucionesFuturas.filter(d => d.fecha.toDateString() === fechaPasado.toDateString()), salidas: salidasFuturas.filter(d => d.fecha.toDateString() === fechaPasado.toDateString()) }
                };
                actualizarResumenCompletoDia('summary-hoy', dataPorDia.hoy.devos, dataPorDia.hoy.salidas, showDevoluciones, showSalidas);
                actualizarResumenCompletoDia('summary-manana', dataPorDia.manana.devos, dataPorDia.manana.salidas, showDevoluciones, showSalidas);
                actualizarResumenCompletoDia('summary-pasado', dataPorDia.pasado.devos, dataPorDia.pasado.salidas, showDevoluciones, showSalidas);
                if (viewMode === 'focus' && focusedDays.size > 1) {
                    const combinedData = { devos: [], salidas: [] };
                    const sortedDays = Array.from(focusedDays).sort((a,b) => Object.keys(dates).indexOf(a) - Object.keys(dates).indexOf(b));
                    sortedDays.forEach(day => { combinedData.devos.push(...dataPorDia[day].devos); combinedData.salidas.push(...dataPorDia[day].salidas); });
                    chartInstances.combined = crearGraficoCombinado(chartInstances.combined, 'chart-combined', combinedData, isStacked, sortedDays.map(d => dates[d]));

            function showToast(message) {

        function inicializarFiltros(data, callback) {
            const agenciasData = [...new Set(data.map(d => d.agencia).filter(Boolean))].sort().map(a => ({ text: a, value: a }));
            const selectAgencia = new SlimSelect({ select: '#filtro-agencia', data: agenciasData, settings: { placeholder: 'Seleccionar agencias...' }, events: { afterChange: callback } });
            selectAgencia.setSelected(agenciasData.map(a => a.value));
            document.getElementById('select-all-agencies').addEventListener('click', () => selectAgencia.setSelected(agenciasData.map(a => a.value)));
            document.getElementById('deselect-all-agencies').addEventListener('click', () => selectAgencia.setSelected([]));
            return { agencia: { getSelected: () => selectAgencia.getSelected() } };
        }

        function actualizarTablaVencidos(vencidos, ahora, fechaHoy) {
            const tbody = document.getElementById('overdue-table-body');
            const countSpan = document.getElementById('alertas-count');
            tbody.innerHTML = '';
            vencidos.sort((a, b) => a.fecha - b.fecha);
            countSpan.textContent = `(${vencidos.length})`;
            if (vencidos.length === 0) {
                tbody.innerHTML = '<tr><td colspan="5" class="p-4 text-center text-gray-500">¡Excelente! No hay devoluciones vencidas.</td></tr>';
                return;
            }
            vencidos.forEach(d => {
                let badgeHTML = '';
                if (d.fecha < fechaHoy) {
                    const diasDeAtraso = Math.floor((fechaHoy - d.fecha) / (1000 * 60 * 60 * 24)) + 1;
                    badgeHTML = `<span class="px-2 py-1 text-xs font-semibold text-red-800 bg-red-100 rounded-full">Vencido (${diasDeAtraso} d)</span>`;
                } else {
                    badgeHTML = `<span class="px-2 py-1 text-xs font-semibold text-yellow-800 bg-yellow-100 rounded-full">Vencido Hoy</span>`;
                }
                const fechaFormateada = d.fecha.toLocaleString('es-AR', { day: '2-digit', month: '2-digit', year: '2-digit', hour: '2-digit', minute: '2-digit' }).replace(',', '');
                const tr = document.createElement('tr');
                tr.innerHTML = `<td class="p-2 border-b border-gray-200">${badgeHTML}</td><td class="p-2 border-b border-gray-200 font-mono">${d.id || 'N/A'}</td><td class="p-2 border-b border-gray-200">${d.agencia || 'N/A'}</td><td class="p-2 border-b border-gray-200">${d.situacion || 'N/A'}</td><td class="p-2 border-b border-gray-200">${fechaFormateada}</td>`;
                tbody.appendChild(tr);
            });
        }
        
        function calcularFranjasHorarias(eventos) {
            let manana = 0, tarde = 0, noche = 0;
            eventos.forEach(d => {
                const h = d.fecha.getHours();
                if (h >= 6 && h < 12) manana++;
                else if (h >= 12 && h < 18) tarde++;
                else noche++;
            });
            return { manana, tarde, noche };
        }

        function actualizarResumenCompletoDia(elementId, devosData, salidasData, showDevoluciones, showSalidas) {
            const elem = document.getElementById(elementId);
            const devosCount = devosData.length;
            const salidasCount = salidasData.length;
            const allEvents = [...devosData, ...salidasData];
            const groupCounts = allEvents.reduce((acc, event) => { if(event.grupo) acc[event.grupo] = (acc[event.grupo] || 0) + 1; return acc; }, {});
            const groupSummary = Object.entries(groupCounts).map(([grupo, count]) => `${grupo} (${count})`).join(', ');
            const franjas = calcularFranjasHorarias(allEvents);
            const totalFranjas = franjas.manana + franjas.tarde + franjas.noche || 1;
            let summaryHTML = '<div>';
            if (showDevoluciones) summaryHTML += `<p><span class="font-semibold">${devosCount}</span> Devoluciones</p>`;
            if (showSalidas) summaryHTML += `<p><span class="font-semibold">${salidasCount}</span> Salidas</p>`;
            if (groupSummary && (showDevoluciones || showSalidas)) summaryHTML += `<p class="text-xs text-gray-500 mt-2"><b>Grupos:</b> ${groupSummary}</p>`;
            summaryHTML += '</div>';
            elem.innerHTML = summaryHTML + `
                <div class="mt-3 pt-3 border-t">
                    <h4 class="text-xs font-bold text-gray-500 mb-2">Carga por Turno</h4>
                    <div class="space-y-1 text-xs">
                        <div class="flex items-center justify-between"><span class="flex items-center gap-2"><i data-lucide="sunrise" class="w-4 h-4 text-amber-500"></i>Mañana (06-12h)</span><div class="w-1/2 bg-gray-200 rounded-full h-2"><div class="bg-amber-400 h-2 rounded-full" style="width: ${(franjas.manana / totalFranjas) * 100}%"></div></div><span>${franjas.manana}</span></div>
                        <div class="flex items-center justify-between"><span class="flex items-center gap-2"><i data-lucide="sunset" class="w-4 h-4 text-orange-500"></i>Tarde (12-18h)</span><div class="w-1/2 bg-gray-200 rounded-full h-2"><div class="bg-orange-400 h-2 rounded-full" style="width: ${(franjas.tarde / totalFranjas) * 100}%"></div></div><span>${franjas.tarde}</span></div>
                        <div class="flex items-center justify-between"><span class="flex items-center gap-2"><i data-lucide="moon-star" class="w-4 h-4 text-indigo-500"></i>Noche (18-06h)</span><div class="w-1/2 bg-gray-200 rounded-full h-2"><div class="bg-indigo-400 h-2 rounded-full" style="width: ${(franjas.noche / totalFranjas) * 100}%"></div></div><span>${franjas.noche}</span></div>
                    </div>
                </div>
            `;
            lucide.createIcons();
        }
        
        function crearGraficoDia(chartInstance, canvasId, devosData, salidasData, esHoy, isStacked, isFocused) {
            if (chartInstance) chartInstance.destroy();
            const ctx = document.getElementById(canvasId).getContext('2d');
            const ahora = new Date();
            const horaActual = ahora.getHours();
            const devosContratoPorHora = Array.from({ length: 24 }, () => []);
            const devosReservaPorHora = Array.from({ length: 24 }, () => []);
            const salidasPorHora = Array.from({ length: 24 }, () => []);
            devosData.filter(d => d.tipo === 'Contrato').forEach(d => devosContratoPorHora[d.fecha.getHours()].push(d));
            devosData.filter(d => d.tipo === 'Reserva').forEach(d => devosReservaPorHora[d.fecha.getHours()].push(d));
            salidasData.forEach(d => salidasPorHora[d.fecha.getHours()].push(d));
            const devosContratoCounts = devosContratoPorHora.map(arr => arr.length);
            const devosReservaCounts = devosReservaPorHora.map(arr => arr.length);
            const salidasCounts = salidasPorHora.map(arr => arr.length);
            let startHour = 8, endHour = 20;
            const allEvents = [...devosData, ...salidasData];
            if (isFocused) {
                startHour = 0; endHour = 23;
            } else if (allEvents.length > 0) {
                const hours = allEvents.map(d => d.fecha.getHours());
                startHour = Math.max(0, Math.min(...hours) - 1);
                endHour = Math.min(23, Math.max(...hours) + 1);
            }
            const labels = Array.from({ length: endHour - startHour + 1 }, (_, i) => (startHour + i).toString().padStart(2, '0') + ':00');
            const slicedDevosContratoCounts = devosContratoCounts.slice(startHour, endHour + 1);
            const slicedDevosReservaCounts = devosReservaCounts.slice(startHour, endHour + 1);
            const slicedSalidasCounts = salidasCounts.slice(startHour, endHour + 1);
            const maxStackedValue = Math.max(...labels.map((_, i) => slicedDevosContratoCounts[i] + slicedDevosReservaCounts[i] + slicedSalidasCounts[i]));

            return new Chart(ctx, {
                type: 'bar',
                data: {
                    labels: labels,
                    datasets: [
                        { label: 'Devolución (Contrato)', data: slicedDevosContratoCounts, backgroundColor: (c) => (esHoy && (startHour + c.dataIndex) < horaActual && slicedDevosContratoCounts[c.dataIndex] > 0) ? '#ef4444' : '#38bdf8', stack: isStacked ? 'main_stack' : 'devoluciones', borderWidth: 1, borderColor: '#ffffff', categoryPercentage: isStacked ? 0.8 : 0.6 },
                        { label: 'Devo (Reserva)', data: slicedDevosReservaCounts, backgroundColor: (c) => (esHoy && (startHour + c.dataIndex) < horaActual && slicedDevosReservaCounts[c.dataIndex] > 0) ? '#ef4444' : '#7dd3fc', stack: isStacked ? 'main_stack' : 'devoluciones', borderWidth: 1, borderColor: '#ffffff', categoryPercentage: isStacked ? 0.8 : 0.6 },
                        { label: 'Salidas', data: slicedSalidasCounts, backgroundColor: '#4ade80', stack: isStacked ? 'main_stack' : 'salidas', borderWidth: 1, borderColor: '#ffffff', categoryPercentage: isStacked ? 0.8 : 0.6 }
                    ]
                },
                options: {
                    responsive: true, maintainAspectRatio: false,
                    scales: { x: { stacked: true, grid: { display: false }, ticks: { autoSkip: true, maxTicksLimit: isFocused ? 24 : 12 } }, y: { stacked: true, beginAtZero: true, ticks: { stepSize: 1 }, max: maxStackedValue > 0 ? maxStackedValue + 3 : 3 } },
                    plugins: {
                        legend: { display: true, position: 'top', align: 'end', labels: { boxWidth: 12, font: { size: 10 }, generateLabels: (chart) => { const labels = [{ text: 'Devolución (Contrato)', fillStyle: '#38bdf8' }, { text: 'Devo (Reserva)', fillStyle: '#7dd3fc' }, { text: 'Salidas', fillStyle: '#4ade80' }]; if(esHoy) labels.push({ text: 'Vencida', fillStyle: '#ef4444' }); return labels; }}},
                        datalabels: {
                            display: (c) => { if (c.dataset.data[c.dataIndex] === 0) return false; const meta = c.chart.getDatasetMeta(c.datasetIndex); if (!meta.stack) return true; let topIdx = -1; for (let i = c.chart.data.datasets.length - 1; i >= 0; i--) { const otherMeta = c.chart.getDatasetMeta(i); if (otherMeta.visible && otherMeta.stack === meta.stack && Number(c.chart.data.datasets[i].data[c.dataIndex]) > 0) { topIdx = i; break; } } return c.datasetIndex === topIdx; },
                            formatter: (v, c) => { const meta = c.chart.getDatasetMeta(c.datasetIndex); if (!meta.stack) return v; let sum = 0; for (let i = 0; i < c.chart.data.datasets.length; i++) { const otherMeta = c.chart.getDatasetMeta(i); if (otherMeta.visible && otherMeta.stack === meta.stack) { sum += Number(c.chart.data.datasets[i].data[c.dataIndex]); } } return sum; },
                            color: '#1e293b', font: { weight: 'bold', size: 9 }, anchor: 'end', align: 'end', offset: -4
                        },
                        tooltip: { mode: 'index', intersect: false, backgroundColor: 'rgba(255, 255, 255, 0.9)', titleColor: '#334155', bodyColor: '#475569', borderColor: '#e2e8f0', borderWidth: 1, callbacks: { footer: (items) => { let footer = ''; const idx = items[0].dataIndex; const hour = startHour + idx; const contratos = devosContratoPorHora[hour]; const reservas = devosReservaPorHora[hour]; const salidas = salidasPorHora[hour]; if (contratos.length > 0 || reservas.length > 0) { footer += `
Total Devoluciones: ${contratos.length + reservas.length}`; if (contratos.length > 0) footer += `
- Contratos: ${contratos.length}`; if (reservas.length > 0) footer += `

  · ${d.id} (${d.grupo || 'N/A'})`; }); } return footer; } } }
                    }
                }
            });
        }

        function crearGraficoCombinado(chartInstance, canvasId, combinedData, isStacked, includedDates) {
            if (chartInstance) chartInstance.destroy();
            const ctx = document.getElementById(canvasId).getContext('2d');
            const ahora = new Date();
            const horaActual = ahora.getHours();
            const esHoy = includedDates.some(d => d.toDateString() === (new Date()).toDateString());

            const labels = [];
            const devosContratoCounts = [];
            const devosReservaCounts = [];
            const salidasCounts = [];
            
            const devosContratoPorHora = {};
            const devosReservaPorHora = {};
            const salidasPorHora = {};

            includedDates.forEach(date => {
                for (let hour = 0; hour < 24; hour++) {
                    const labelDate = new Date(date);
                    labelDate.setHours(hour);
                    const label = labelDate.toLocaleString('es-AR', { day: 'numeric', month: 'numeric', hour: '2-digit', minute: '2-digit' });
                    labels.push(labelDate);
                    
                    const key = labelDate.toISOString().substring(0, 13);
                    devosContratoPorHora[key] = [];
                    devosReservaPorHora[key] = [];
                    salidasPorHora[key] = [];

                    devosContratoCounts.push(0);
                    devosReservaCounts.push(0);
                    salidasCounts.push(0);
                }
            });
            
            const processEvent = (event, countsArray, byHourObject) => {
                const eventDate = new Date(event.fecha);
                const key = eventDate.toISOString().substring(0, 13);
                const index = Math.floor((eventDate - labels[0]) / (1000 * 60 * 60));

                if (index >= 0 && index < labels.length) {
                    countsArray[index]++;
                    byHourObject[key].push(event);
                }
            };
            
            combinedData.devos.filter(d => d.tipo === 'Contrato').forEach(d => processEvent(d, devosContratoCounts, devosContratoPorHora));
            combinedData.devos.filter(d => d.tipo === 'Reserva').forEach(d => processEvent(d, devosReservaCounts, devosReservaPorHora));
            combinedData.salidas.forEach(d => processEvent(d, salidasCounts, salidasPorHora));

            const maxStackedValue = Math.max(...labels.map((_, i) => devosContratoCounts[i] + devosReservaCounts[i] + salidasCounts[i]));

            return new Chart(ctx, {
                type: 'bar',
                data: {
                    labels: labels,
                    datasets: [
                        { label: 'Devolución (Contrato)', data: devosContratoCounts, backgroundColor: '#38bdf8', stack: isStacked ? 'main_stack' : 'devoluciones', borderWidth: 1, borderColor: '#ffffff', categoryPercentage: 0.8 },
                        { label: 'Devo (Reserva)', data: devosReservaCounts, backgroundColor: '#7dd3fc', stack: isStacked ? 'main_stack' : 'devoluciones', borderWidth: 1, borderColor: '#ffffff', categoryPercentage: 0.8 },
                        { label: 'Salidas', data: salidasCounts, backgroundColor: '#4ade80', stack: isStacked ? 'main_stack' : 'salidas', borderWidth: 1, borderColor: '#ffffff', categoryPercentage: 0.8 }
                    ]
                },
                options: {
                    responsive: true, maintainAspectRatio: false,
                    scales: { 
                        x: { 
                            type: 'time',
                            time: { unit: 'hour', displayFormats: { hour: 'HH:mm' }, tooltipFormat: 'dd/MM HH:mm' },
                            stacked: true, 
                            grid: { display: false }, 
                            ticks: { major: { enabled: true }, font: (context) => { if (context.tick && context.tick.major) { return { weight: 'bold' }; } } }
                        }, 
                        y: { stacked: true, beginAtZero: true, ticks: { stepSize: 1 }, max: maxStackedValue > 0 ? maxStackedValue + 3 : 3 } 
                    },
                    plugins: {
                        legend: { display: true, position: 'top', align: 'end', labels: { boxWidth: 12, font: { size: 10 } } },
                        datalabels: {
                            display: (c) => { if (c.dataset.data[c.dataIndex] === 0) return false; const meta = c.chart.getDatasetMeta(c.datasetIndex); if (!meta.stack) return true; let topIdx = -1; for (let i = c.chart.data.datasets.length - 1; i >= 0; i--) { const otherMeta = c.chart.getDatasetMeta(i); if (otherMeta.visible && otherMeta.stack === meta.stack && Number(c.chart.data.datasets[i].data[c.dataIndex]) > 0) { topIdx = i; break; } } return c.datasetIndex === topIdx; },
                            formatter: (v, c) => { const meta = c.chart.getDatasetMeta(c.datasetIndex); if (!meta.stack) return v; let sum = 0; for (let i = 0; i < c.chart.data.datasets.length; i++) { const otherMeta = c.chart.getDatasetMeta(i); if (otherMeta.visible && otherMeta.stack === meta.stack) { sum += Number(c.chart.data.datasets[i].data[c.dataIndex]); } } return sum; },
